import React from 'react';
import '../App.css';

export function LocationFrame(props) {

    return (
        <div id={props.id} className='App-weatherComp'>
            <h3>{props.name}</h3>
            <img src={require(`./resources/WeatherIcons/${props.weather}.svg`)} alt='Weather icon' className='App-icons'/>
            <p>{props.temp} &deg;</p>
            <p>{props.wind} m/s</p>

        </div>
    )
}
